import React from 'react';

const FichaOrtodoncia = ({ data }) => {
  if (!data) {
    return (
      <div className="bg-white p-4 rounded-lg shadow">
        <h3 className="text-lg font-semibold mb-2">Ficha Ortod贸ntica</h3>
        <p className="text-gray-500">No hay datos disponibles.</p>
      </div>
    );
  }

  return (
    <div className="bg-white p-4 rounded-lg shadow">
      <h3 className="text-lg font-semibold mb-4">Ficha Ortod贸ntica</h3>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <div>
          <label className="block text-sm font-medium text-gray-700">Tipo de maloclusi贸n</label>
          <p className="mt-1 text-gray-900">{data.maloclusion || 'No especificado'}</p>
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Plan de tratamiento</label>
          <p className="mt-1 text-gray-900">{data.planTratamiento || 'No especificado'}</p>
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Duraci贸n estimada</label>
          <p className="mt-1 text-gray-900">{data.duracion || 'No especificada'}</p>
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Controles programados</label>
          <ul className="mt-1 text-gray-900 list-disc pl-5 space-y-1">
            {(data.controles || []).length > 0 ? (
              data.controles.map((ctrl, i) => <li key={i}>{ctrl}</li>)
            ) : (
              <li>No hay controles registrados</li>
            )}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default FichaOrtodoncia;
